import React from 'react';
import { Route } from 'react-router-dom';
import Homepage from './pages/homepage/homepage.component';
import './App.css';


const HatsPage = () => (
  <div>
    <h1>Hats Page</h1>
  </div>
);



function App() {
  return (
  <div>
    <Route exact path='/' component={Homepage} />
    <Route exact path='/' component={HatsPage} />
  </div>
  );
}

export default App;
